import React from "react";

const SearchBar = ({ keyword, setKeyword }) => {
  const onFormSubmit = ({ keyword }) => {};

  const BarStyling = {
    width: "20rem",
    background: "grey",
    border: "none",
    padding: "0.5rem",
  };
  return (
    <form onSubmit={() => onFormSubmit(keyword)}>
      <input
        style={BarStyling}
        key="random1"
        value={keyword}
        placeholder={"Search "}
        onChange={(e) => setKeyword(e.target.value)}
      />
    </form>
  );
};

export default SearchBar;
